function makeTheIntegerZero(num1: number, num2: number): number {
    if (num1 === 0) return 0;
    if (num2 === 0) return -1;

    let operations = 0;
    while (num1 !== 0 && operations <= 60) {
        let found = false;
        for (let i = 60; i >= 0; i--) {
            if ((2 ** i + num2) <= num1) {
                num1 -= (2 ** i + num2);
                operations++;
                found = true;
                break;
            }
        }
        if (!found) {
            if (num1 - num2 < 0 && num1 - num2 + 1 === 0) {
                operations++;
                break;
            } else return -1;
        }
    }

    return num1 === 0 ? operations : -1;
};
